# datasets is native, datasets2 is wasm auto instance (env  3) and datasets3 is wasm one instance (env 2)
def plot_results(datasets, datasets2, datasets3, legends, sfs, query, algos, queries, alglen):
    # parse data
    fig, ax = plt.subplots(1, alglen, figsize=(15, 5))
    fig.suptitle('Results for Query {} : {}'.format(query, queries[query]), fontweight='bold', fontsize=15)
    # set three fixed colors
    colors = ['b', 'g', 'r']
    for algorithm in range(alglen): # for each algorithm
        xs = []
        xs2 = []
        xs3 = []
        ys3 = []
        ys = []
        ys2 = []
        for i in range(9): # for each sf
            sf = sfs[i]
            x, y, _, _ = datasets[sf][algorithm][query]
            x2, y2, _, _, _ = datasets2[sf][algorithm][query]
            x3, y3, _, _ , _= datasets3[sf][algorithm][query]
            xs3 += [float(sf)]
            ys3 += [y3]
            xs2 += [float(sf)]
            ys2 += [y2]
            xs += [float(sf)]
            ys += [y]
    
        leg1=legends[0:3]

        # Since it is the same legend we print it once at the right of all figures
        # Make the legend with a nice box and at the right
        fig.legend(leg1, loc='center right', bbox_to_anchor=(1, 0.5), fontsize='large')
    
        color = colors[0]
        ax[algorithm].plot(xs, ys, color=color, marker='x')
        color = colors[1]
        ax[algorithm].plot(xs2, ys2, color=color, marker='o')
        color = colors[2]
        ax[algorithm].plot(xs3, ys3, color=color, marker='^')
        ax[algorithm].set_xlabel('Scale Factor')
        ax[0].set_ylabel('Runtime (seconds)')
        ax[algorithm].set_title(algos[algorithm])
        ax[algorithm].legend()

        # plot all algorithms native | wasm
        # ax[alglen].plot(xs, ys, color=colo')
        # ax[alglen].set_ylabel('Runtime (secr)
        # ax[alglen].set_xlabel('Scale Factoronds)')
        # ax[alglen].set_title('Native runtimes (logscale)')
        # ax[alglen].legend()
        # ax[alglen].set_yscale('log')
        # ax[alglen+1].plot(xs2, ys2, color=color, linestyle='dashed')
        # ax[alglen+1].set_xlabel('Scale Factor')
        # ax[alglen+1].set_ylabel('Runtime (seconds)')
        # ax[alglen+1].set_title('Wasm runtimes (logscale)')
        # ax[alglen+1].legend()
        # ax[alglen+1].set_yscale('log')
        # ax[alglen+2].plot(xs3, ys3, color=color, linestyle='dotted')
        # ax[alglen+2].set_xlabel('Scale Factor')
        # ax[alglen+2].set_ylabel('Runtime (seconds)')
        # ax[alglen+2].set_title('Orchestrator runtimes (logscale)')
        # ax[alglen+2].legend()
        # ax[alglen+2].set_yscale('log')

        sum_native = sum(ys)
        sum_wasm_1 = sum(ys2)
        sum_wasm_2 = sum(ys3)
        ratio = sum_native / sum_wasm_1
        ratio2 = sum_native / sum_wasm_2

        ax[algorithm].text(0.15, 0.8, 'Ratio: {:.2f}'.format(ratio), horizontalalignment='center', verticalalignment='center', transform=ax[algorithm].transAxes)
        ax[algorithm].text(0.15, 0.7, 'Ratio2: {:.2f}'.format(ratio2), horizontalalignment='center', verticalalignment='center', transform=ax[algorithm].transAxes)

